import React from "react";
import { Entypo } from "@expo/vector-icons";
import {
  Dimensions,
  ScrollView,
  Text,
  View,
  KeyboardAvoidingView,
  Platform,
  Modal,
  ActivityIndicator,
  Alert,
  SafeAreaView,
} from "react-native";
import { FAB } from "react-native-paper";
import { SvgXml } from "react-native-svg";
import { useSelector } from "react-redux";
import { Color } from "../../assets/colors";
import { AntDesign } from "@expo/vector-icons";
import Input from "../../components/Input";
import TextArea from "../../components/TextArea";
import IconButton from "../../components/IconButton";
import { getOfflineMembers } from "../../Class/member";
import {
  createOfflineNote,
  createOnlineNote,
  deleteNote,
  getOfflineNotes,
  getOnlineNotes,
  setNoteNotification,
  unSetNotification,
} from "../../Class/notes";
import DateTimePickerModal from "react-native-modal-datetime-picker";
import { TouchableOpacity } from "react-native-gesture-handler";
import {
  allTimeConverter,
  convertDate,
  dateConverter,
  dateDifference,
  timeConverter,
} from "../../action";
import { StatusBar } from "expo-status-bar";
const { width, height } = Dimensions.get("window");

export default function Note({ navigation, route }) {
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const textColor = colors.getTextColor();
  const primaryColor = colors.getPrimaryColor();
  const assentColor = colors.getAssentColor();
  const [Data, setData] = React.useState();
  const offline = route.params && route.params.offline ? true : false;
  const user = useSelector((state) => state.user);
  const vendor = useSelector((state) => state.vendor);
  const newUser = route.params.user;
  const [Reload, setReload] = React.useState(false);

  // console.log(newUser)
  React.useEffect(() => {
    if (user && vendor) {
      if (offline) {
        getOfflineNotes(user.token, newUser.id, vendor.service.id)
          .then((res) => {
            //console.log(res.data)
            setData(res.data.notes);
          })
          .catch((err) => {
            console.warn(err.response.data.msg);
          });
      } else {
        getOnlineNotes(user.token, newUser.id, vendor.service.id)
          .then((res) => {
            //console.log(res.data)
            setData(res.data.notes);
          })
          .catch((err) => {
            console.warn(err.response.data.msg);
          });
      }
    }
  }, [user + vendor + Reload]);

  const save = () => {
    setReload((val) => !val);
    //navigation.goBack();
  };
  const Delete = (id) => {
    try {
      deleteNote(user.token, id)
        .then((res) => {
          setReload((val) => !val);
        })
        .catch((err) => {
          Alert.alert("Opps!", err.response.data);
        });
    } catch (e) {
      console.warn(e.message);
    }
  };
  const notify = (id, date, time) => {
    setNoteNotification(
      user.token,
      dateConverter(date),
      allTimeConverter(time),
      vendor.service.id,
      id
    )
      .then((res) => {
        Alert.alert("Success", "Alert set successful");
        setReload((val) => !val);
      })
      .catch((err) => {
        Alert.alert("Opps!", err.response.data.msg);
      });
  };
  return (
    <SafeAreaView style={{ flex: 1 }}>
      <View
        style={{
          flexDirection: "row",
          paddingHorizontal: 20,
          alignItems: "center",
          borderColor: "#F1EFEF",
          borderBottomWidth: 0.5,
          paddingVertical: 5,
          paddingTop: 10,
        }}>
        <AntDesign
          onPress={() => {
            navigation.goBack();
          }}
          name="left"
          size={24}
          color="#C1D3F7"
        />
        <Text
          style={{
            fontSize: 16,
            fontFamily: "Poppins-Medium",
            color: "#C1D3F7",
            marginLeft: 10,
          }}>
          Note
        </Text>
      </View>
      {Data ? (
        <ScrollView showsVerticalScrollIndicator={false}>
          <View style={{ justifyContent: "center", alignItems: "center" }}>
            <SvgXml style={{ marginTop: 30 }} xml={svgIcon} width="70%" />
          </View>
          {Data && Data.length == 0 && (
            <Text
              style={{
                fontSize: 16,
                color: textColor,
                marginTop: 30,
                textAlign: "center",
              }}>
              No Note Found
            </Text>
          )}
          <View
            style={{
              flexDirection: "row",
              flexWrap: "wrap",
              marginHorizontal: 20,
            }}>
            {Data.map(
              (doc, i) =>
                doc.date && (
                  <NoteCart
                    onPress={(color) => {
                      navigation.navigate("ViewNote", {
                        data: doc,
                        color: color,
                        reload: Delete,
                        notify: notify,
                        save: save,
                      });
                    }}
                    key={i}
                    data={doc}
                  />
                )
            )}
            {Data.map(
              (doc, i) =>
                !doc.date && (
                  <NoteCart
                    onPress={(color) => {
                      navigation.navigate("ViewNote", {
                        data: doc,
                        color: color,
                        reload: Delete,
                        notify: notify,
                      });
                    }}
                    key={i}
                    data={doc}
                  />
                )
            )}
          </View>
          <View style={{ height: 80 }} />
        </ScrollView>
      ) : (
        <Text
          style={{
            textAlign: "center",
            marginTop: 30,
          }}>
          Loading...
        </Text>
      )}

      <FAB
        color="#FFFFFF"
        icon="plus"
        style={{
          position: "absolute",
          borderRadius: 30,
          backgroundColor: "#43B05C",
          bottom: 20,
          right: 20,
          width: 50,
          height: 50,
          justifyContent: "center",
          alignItems: "center",
        }}
        onPress={() => {
          navigation.navigate("AddNote", {
            save: save,
            user: newUser,
            offline: offline,
          });
        }}
      />
    </SafeAreaView>
  );
}

